import React, { useState } from "react";

const inspectors = [
  { name: "Johan Svensson", lake: "Vialundasjön", phone: "070-123 45 67" },
  { name: "Mats Andersson", lake: "Kvarnsjön", phone: "070-987 65 43" },
  { name: "Abed Balhawan", lake: "Sickelsjön", phone: "070-xxx xx xx" }
];

import { useLocation } from "react-router-dom";

function Contact() {
  const location = useLocation();
  const [contactType, setContactType] = useState("general");

  useEffect(() => {
    const params = new URLSearchParams(location.search);
    const type = params.get("type");
    if (type) setContactType(type);
  }, [location]);

  return (
    <div>
      {contactType === "general" && <p>Här är kontaktinformationen för allmänt.</p>}
      {contactType === "inspectors" && <p>Här är kontaktuppgifter till tillsynsmän.</p>}
    </div>
  );
}

export default Contact;
